import styled from 'styled-components';

export const CategoryItemWrapper = styled.div`
  text-align: center;
  padding: 10px;
  .icCategory {
    font-size: 40px;
  }
  .txtName {
    margin-top: 15px;
  }
  @media (max-width: 577px) {
  }
`;
